import React, { useState } from 'react'
import Editor from 'Editor';

const NewPost = () => {
    const [markdown, setMarkdown] = useState()
    return (
        <div>
            <Editor value={markdown} onChange={
                () => { setMarkdown(value) }
            } />
        </div>
    )
}

export default NewPost
